import React from 'react'
import  Novicedetails  from './Novicedetails'
import { uproduct } from './uproducts'

export function University() {

    return (
        <div className='md-3'>
            {uproduct.map((uproduct) => (
                <NUniversitydetails nproduct={uproduct} />
            ))}
        </div>
    )
}
